import React from 'react';

export function Navs(props) {
    const names = props.titles.map(eachTitle =>
        <li className="nav-item py-1" key={eachTitle}><a href={eachTitle} className="nav-link text-primary">{eachTitle}</a></li>);
    return (
            <nav id="links" className='navbar navbar-expand py-1 bg-light'>
                <ul className="navbar-nav">
                    {names}
                </ul>
            </nav>
    )
}
